import React from "react";

function Pizza() {
  return <h2>Pizza</h2>;
}

export default function App() {
  return (
    <div>
      <h1>Hello React!</h1>
      <Pizza />
      <img src="pizzas/spinaci.jpg" alt="spianac pizza" />
    </div>
  );
}
